import React from 'react'

interface Props{
    data : {
        title?: string,
        teacher?: string,
        deadline?: string,
        scienceArea?: string,
        description?: string,
        reportFile?: string,
        presentationFile?: string,
        consultantReportFile?: string,
        link?: string,
    }
}

class AttachedFiles extends React.Component<Props>{


    render(){
        return(
        <div className='attached'>
            <p>{this.props.data.reportFile !== ''? 'Отчет: ' + this.props.data.reportFile: ''}</p>
            <p>{this.props.data.presentationFile !== ''? 'Презентация: ' + this.props.data.presentationFile : ''}</p>
            <p>{this.props.data.consultantReportFile !== ''? 'Отчет: ' + this.props.data.consultantReportFile : ''}</p>
            <p>{this.props.data.link !== ''? 'Ссылка: ' + this.props.data.link : ''}</p>
        </div>
        )
    }
}

export default AttachedFiles
